contracts/ExtraStorage.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

// 不要忘了要加"./"
import "./StorageFactory.sol"; 

// 继承关键字“is”，现在ExtraStorage智能合约 继承了 SimpleStorage智能合约
//继承需要做3件事
    // 在contract这里加上“is”关键字
    // 在需要被override的函数原处的public后面加上 ”virtual“ 关键字
    // 在overrided的函数的public后面加上 ”override“ 关键字
contract ExtraStorage is SimpleStorage{

    // 这里加了 override
    function store(uint256 _favoriteNumber) public override {
        favoriteNumber = _favoriteNumber + 10;
    }

}

contracts/StorageFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;     // 一个package下的不同.sol文件需要拥有 相同 的solodoty版本号

// 大致思路

    // 创建一个array来储存不同的simpleStorage objects，同时写：
    // 函数1:在这个array中add simpleStorage objects
    // 函数2:在这个array中为simpleStorage object 来 store 这个 simpleStorage 的 favoriteNumber
    // 函数3:查看此array中的各个object的favoriteNumber是多少

// import "SimpleStorage.sol"这个contract
import "./SimpleStorage.sol";

contract StorageFactory{

    // 创建一个array来储存不同的simpleStorage objects
    SimpleStorage[] public simpleStorageArray;

    // 函数1:在这个array中add simpleStorage objects
    function createSimpleStorage() public {
        SimpleStorage simpleStorage = new SimpleStorage();
        simpleStorageArray.push(simpleStorage);
    } 

    /*
    @param _simpleStorageIndex 需要store favoriteNumber 的 simpleStorage 在array中的index
    @param _simpleStorageFavoriteNumber 此simpleStorage 的 favoriteNumber
    @return void
    */
    function storeFavoriteNumber(uint256 _simpleStorageIndex, uint256 _simpleStorageFavoriteNumber) public{
        SimpleStorage simpleStorage = simpleStorageArray[_simpleStorageIndex];
        simpleStorage.store(_simpleStorageFavoriteNumber);
    }

    /*
    @param _simpleStorageIndex 需要查看 此simpleStorage 的 favoriteNumber 是多少
    @return 此simpleStorage 的 favoriteNumber
    */
    function getFavoriteNumber(uint256 _simpleStorageIndex) public view returns(uint256){
        SimpleStorage simpleStorage = simpleStorageArray[_simpleStorageIndex];
        return simpleStorage.retrieve();

        //为了省gas，也可写成：
        // return simpleStorageArray[_simpleStorageIndex].retrieve();
    }



}

contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract SimpleStorage{

    // data types in Solidity:

        // boolean, unit (unsigned int), int, address, bytes, string

    // data types examples:

        // bool hasBalance = false; 
        // uint256 favoriteNumber = 123;   // unit32,unit64,都可以，最大是256
        // int256 favoriteNumber2 = -456;
        // address myAddress = 0xCe916268Fdfcf316FeB2f245840Ba7f3d26Fd339;
        // bytes32 favoriteBytes = "cat";  //bytes就是char的hex表达形式，bytes32只能是32
        // string favoriteNumberInText = "Five";

    // 怎么 run

        // compile -> deploy -> 到deployed contracts中操作
        // smart contract本质上就是一个写在block的data中的数据，
        //  而data中的数据就是一个一个交易，所以其实智能合约就是一个交易
        //  因此，智能合约这个交易需要付gas fee来部署，同时也有个交易的hash，即智能合约地址

    // 正式开始

        // 带下划线的是参数，不能是全局变量
        // internal是private，public就是public，如果不在一开始标明，默认是internal
        // public标识符在中间，不在最开始

        // 消耗的gas主要看“transaction cost”这一栏的gas
        // Deploy做菜单栏的Deployed contracts中的变量0, 1, 就是看code中的位置。比如favoriteNumber在[0], people在[1]
        // Deploy做菜单栏的Deployed contract中会显示所有public的variables和函数


    // uint256 internal favoriteNumber;
    uint256 public favoriteNumber;                                             // Deploy做菜单栏的Deployed contracts中:[0]
    // People public people = People({favoriteNumber : 2, name : "Patrick"});  // Deploy做菜单栏的Deployed contracts中: [1]


    // array, struct, mapping是solidity中的三大特殊数据结构

    // array
    People[] public people; //solidity中的array是dynamic的，不用一开始固定长度

    // struct
    struct People{
        uint256 favoriteNumber;
        string name;
    }

    // mapping （就是hashmap数据结构）
    mapping(string => uint256) public nameToFavoriteNumber; // key是string类型，value是uint256类型



    //只规定了public
    function store(uint256 _favoriteNumber) public virtual {    // 这里为了 ExtraStorage.sol 的继承加上了 virtual 关键字
        favoriteNumber = _favoriteNumber;
        favoriteNumber = favoriteNumber + 1;  
    }

    //规定了public，还规定了return value data type：unit256. 语句：view returns(unit256)
    function retrieve() public view returns(uint256){
        return favoriteNumber;
    }

    // view 和 pure 不消耗 gas
        // view returns() 是只读函数，只能return local variables，不能modify。相当于getter()
        // pure return() 是不可读不可modify函数，常用于把常使用且冗长的计算算法写进来，然后在其他函数中调用

        // view 和 pure 不消耗gas，但是一个需要消耗gas的函数中调用view 和 pure 需要消耗 gas

    // pure函数例子
    function pureFunctionExample() public pure returns(uint256){
        return (4+5); 
    }

    // 所有非数字的函数param都需要决定是临时的local variables，还是存在区块链上（相当于global variables)
    // calldata 用于生命传入函数的参数不可被改变。如在函数中写 _name = "new name jayyy";会报错
    // memory 用于声明函数内部的临时变量，这些变量在函数执行完后会被销毁。
    // storage 用于声明合约的持久状态变量，这些变量存储在区块链上，直到被显式修改。（上链后依然可修改）

    // 注意，在 “function addPerson(string memory _name, uint256 _favoriteNumber)”  里，只能是 memory 或 calldata
    // 因为( )中的都是参数，是不可能被存在哪的，只能在栈上，所以只能 memory 或 calldata 二选一，绝对不可能是 storage
    // 但是函数内部的 “People memory newPerson = People({favoriteNumber: _favoriteNumber, name: _name});” 可以是storage
    function addPerson(string memory _name, uint256 _favoriteNumber) public {
        People memory newPerson = People({favoriteNumber: _favoriteNumber, name: _name});
        people.push(newPerson);                        // 将新的people object add 进 array
        nameToFavoriteNumber[_name] = _favoriteNumber; // 将_name: _favoriteNumber add 进 hashmap
    }

    // EVM 可以在以下6个地方储存数据
        // Stack
        // Memory
        // Storage
        // Calldata
        // Code
        // Logs


}

